import React, { useState } from 'react';

const SocialFeed = () => {
  const [activeTab, setActiveTab] = useState('all');
  const [posts, setPosts] = useState([
    {
      id: 1,
      platform: 'instagram',
      author: 'designinspo',
      content: 'Check out this amazing UI design for a learning app!',
      image: 'https://via.placeholder.com/400x300/6366F1/FFFFFF?text=UI+Design',
      likes: 245,
      comments: 32,
      timestamp: '2 hours ago'
    },
    {
      id: 2,
      platform: 'tiktok',
      author: 'codingwithsara',
      content: 'Learn React hooks in 60 seconds! #coding #react #webdev',
      video: true,
      likes: 1024,
      comments: 76,
      timestamp: '4 hours ago'
    },
    {
      id: 3,
      platform: 'pinterest',
      author: 'webdevresources',
      content: 'Color palettes for your next web project',
      image: 'https://via.placeholder.com/400x600/F43F5E/FFFFFF?text=Color+Palettes',
      likes: 512,
      comments: 8,
      timestamp: '1 day ago'
    },
    {
      id: 4,
      platform: 'reddit',
      author: 'u/javascriptpro',
      content: 'What are your favorite JavaScript libraries in 2025? I\'ve been using React for years but looking to try something new.',
      likes: 89,
      comments: 124,
      timestamp: '5 hours ago',
      subreddit: 'r/webdev'
    }
  ]) ;
  
  const [connectedAccounts, setConnectedAccounts] = useState([
    { platform: 'instagram', connected: true },
    { platform: 'tiktok', connected: true },
    { platform: 'pinterest', connected: true },
    { platform: 'reddit', connected: true },
    { platform: 'quora', connected: false }
  ]);
  
  const filteredPosts = posts.filter(post => {
    if (activeTab === 'all') return true;
    return post.platform === activeTab;
  });
  
  return (
    <div className="space-y-6">
      <div className="bg-white dark:bg-gray-800 rounded-lg shadow p-6">
        <h1 className="text-3xl font-bold text-gray-900 dark:text-white mb-4">Social Feed</h1>
        <p className="text-gray-600 dark:text-gray-300 mb-6">
          Your unified feed from all connected social platforms
        </p>
        
        {/* Platform Tabs */}
        <div className="flex space-x-2 overflow-x-auto pb-2 mb-6">
          <button 
            onClick={() => setActiveTab('all')}
            className={`px-4 py-2 rounded-full ${activeTab === 'all' ? 'bg-indigo-600 text-white' : 'bg-gray-200 dark:bg-gray-700 text-gray-700 dark:text-gray-200'}`}
          >
            All
          </button>
          <button 
            onClick={() => setActiveTab('instagram')}
            className={`px-4 py-2 rounded-full ${activeTab === 'instagram' ? 'bg-gradient-to-r from-purple-500 to-pink-500 text-white' : 'bg-gray-200 dark:bg-gray-700 text-gray-700 dark:text-gray-200'}`}
          >
            Instagram
          </button>
          <button 
            onClick={() => setActiveTab('tiktok')}
            className={`px-4 py-2 rounded-full ${activeTab === 'tiktok' ? 'bg-black text-white' : 'bg-gray-200 dark:bg-gray-700 text-gray-700 dark:text-gray-200'}`}
          >
            TikTok
          </button>
          <button 
            onClick={() => setActiveTab('pinterest')}
            className={`px-4 py-2 rounded-full ${activeTab === 'pinterest' ? 'bg-red-600 text-white' : 'bg-gray-200 dark:bg-gray-700 text-gray-700 dark:text-gray-200'}`}
          >
            Pinterest
          </button>
          <button 
            onClick={() => setActiveTab('reddit')}
            className={`px-4 py-2 rounded-full ${activeTab === 'reddit' ? 'bg-orange-600 text-white' : 'bg-gray-200 dark:bg-gray-700 text-gray-700 dark:text-gray-200'}`}
          >
            Reddit
          </button>
        </div>
        
        {/* Posts */}
        <div className="space-y-6">
          {filteredPosts.map(post => (
            <div key={post.id} className="bg-gray-50 dark:bg-gray-700 rounded-lg p-4">
              <div className="flex items-center mb-3">
                <div className={`w-10 h-10 rounded-full flex items-center justify-center text-white ${
                  post.platform === 'instagram' ? 'bg-gradient-to-r from-purple-500 to-pink-500' :
                  post.platform === 'tiktok' ? 'bg-black' :
                  post.platform === 'pinterest' ? 'bg-red-600' :
                  'bg-orange-600'
                }`}>
                  {post.platform.charAt(0).toUpperCase()}
                </div>
                <div className="ml-3">
                  <p className="font-medium text-gray-900 dark:text-white">{post.author}</p>
                  <p className="text-sm text-gray-500 dark:text-gray-400">
                    {post.platform.charAt(0).toUpperCase() + post.platform.slice(1)} • {post.timestamp}
                    {post.subreddit && ` • ${post.subreddit}`}
                  </p>
                </div>
              </div>
              
              <p className="text-gray-800 dark:text-gray-200 mb-3">{post.content}</p>
              
              {post.image && (
                <div className="mb-3 rounded-lg overflow-hidden">
                  <img src={post.image} alt="Post content" className="w-full h-auto" />
                </div>
              )}
              
              {post.video && (
                <div className="mb-3 rounded-lg overflow-hidden bg-gray-200 dark:bg-gray-600 h-48 flex items-center justify-center">
                  <span className="text-gray-500 dark:text-gray-400">Video Content</span>
                </div>
              )}
              
              <div className="flex space-x-4">
                <button className="flex items-center text-gray-500 dark:text-gray-400 hover:text-indigo-600 dark:hover:text-indigo-400">
                  <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-1" viewBox="0 0 20 20" fill="currentColor">
                    <path d="M2 10.5a1.5 1.5 0 113 0v6a1.5 1.5 0 01-3 0v-6zM6 10.333v5.43a2 2 0 001.106 1.79l.05.025A4 4 0 008.943 18h5.416a2 2 0 001.962-1.608l1.2-6A2 2 0 0015.56 8H12V4a2 2 0 00-2-2 1 1 0 00-1 1v.667a4 4 0 01-.8 2.4L6.8 7.933a4 4 0 00-.8 2.4z" />
                  </svg>
                  {post.likes}
                </button>
                <button className="flex items-center text-gray-500 dark:text-gray-400 hover:text-indigo-600 dark:hover:text-indigo-400">
                  <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-1" viewBox="0 0 20 20" fill="currentColor">
                    <path fillRule="evenodd" d="M18 5v8a2 2 0 01-2 2h-5l-5 4v-4H4a2 2 0 01-2-2V5a2 2 0 012-2h12a2 2 0 012 2zM7 8H5v2h2V8zm2 0h2v2H9V8zm6 0h-2v2h2V8z" clipRule="evenodd" />
                  </svg>
                  {post.comments}
                </button>
                <button className="flex items-center text-gray-500 dark:text-gray-400 hover:text-indigo-600 dark:hover:text-indigo-400">
                  <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-1" viewBox="0 0 20 20" fill="currentColor">
                    <path d="M15 8a3 3 0 10-2.977-2.63l-4.94 2.47a3 3 0 100 4.319l4.94 2.47a3 3 0 10.895-1.789l-4.94-2.47a3.027 3.027 0 000-.74l4.94-2.47C13.456 7.68 14.19 8 15 8z" />
                  </svg>
                  Share
                </button>
                <button className="flex items-center text-gray-500 dark:text-gray-400 hover:text-indigo-600 dark:hover:text-indigo-400">
                  <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-1" viewBox="0 0 20 20" fill="currentColor">
                    <path d="M5 4a2 2 0 012-2h6a2 2 0 012 2v14l-5-2.5L5 18V4z" />
                  </svg>
                  Save
                </button>
              </div>
            </div>
          ) )}
        </div>
      </div>
      
      {/* Connected Accounts */}
      <div className="bg-white dark:bg-gray-800 rounded-lg shadow p-6">
        <h2 className="text-xl font-bold text-gray-900 dark:text-white mb-4">Connected Accounts</h2>
        <div className="space-y-3">
          {connectedAccounts.map(account => (
            <div key={account.platform} className="flex items-center justify-between p-3 bg-gray-50 dark:bg-gray-700 rounded-lg">
              <div className="flex items-center">
                <div className={`w-10 h-10 rounded-full flex items-center justify-center text-white ${
                  account.platform === 'instagram' ? 'bg-gradient-to-r from-purple-500 to-pink-500' :
                  account.platform === 'tiktok' ? 'bg-black' :
                  account.platform === 'pinterest' ? 'bg-red-600' :
                  account.platform === 'reddit' ? 'bg-orange-600' :
                  'bg-blue-600'
                }`}>
                  {account.platform.charAt(0).toUpperCase()}
                </div>
                <div className="ml-3">
                  <p className="font-medium text-gray-900 dark:text-white">
                    {account.platform.charAt(0).toUpperCase() + account.platform.slice(1)}
                  </p>
                </div>
              </div>
              <div>
                {account.connected ? (
                  <span className="px-3 py-1 bg-green-100 text-green-800 dark:bg-green-900 dark:text-green-200 rounded-full text-sm">
                    Connected
                  </span>
                ) : (
                  <button className="px-3 py-1 bg-indigo-600 text-white rounded-full text-sm hover:bg-indigo-700 transition">
                    Connect
                  </button>
                )}
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default SocialFeed;
